def get_random_grades(num_students):
        # generate a random grades array
        grades = sample(range(100), num_students)
        return grades

    def calculate_average(grades):
        # calculate the average grade of students
        return sum(grades) / len(grades)

    def calculate_passing(grades):
        # calculate the number of passing grade students
        return len([grade for grade in grades if grade >= 60])

